Witam,
auto w bardzo dobrym stanie, posiada bogate wyposażenie:
-klimatyzacja automatyczna;
-elektryczne szyby;
-elektryczne lusterka;
-czujniki parkowania;
-reflektory ksenonowe;
-automatyczne światła do jazdy dziennej;
-fotele półskórzane;
-kierownica multimedialna;
-zestaw głosnomówiący;
-rolety szyb tylnych;
-alufelgi Irmscher oryginalne;
W ostatnim czasie w aucie wymieniono:
-głowica;
-olej i filtry;
-rozrząd;
-tarcze i klocki;
-zregenerowano tylny wózek, wszystkie tuleje wymienione na poliuretan;
-wszystkie wtryski wyczyszczone i wyregulowane;
-zregenerowana turbina;
-usunięto klapy kolektora dolotowego wraz z wyprogramowaniem ze sterownika;
-wyprogramowany i zaślepiony egr;
Zapraszam do kontaktu 
