Skoda Octavia Tour Kombi 1.6 MPI 102 KM + LPG, rocznik 2008, przebieg 242.000 km.
• 
PIERWSZY WŁAŚCICIEL
, kupiona w polskim salonie;
• 
NOWA (2023) instalacja gazowa 
STAG, zbiornik z homologacją do 2029;
• Automatyczna klimatyzacja – 
Climatronic
;
• Radio Symphony Skoda;
• Tylne czujniki parkowania;
• Alarm + blokada skrzyni typu Bear Lock;
• Centralny zamek z domykaniem szyb;
• Opony całoroczne, Fulda MultiControl, wymienione w 2023;
• Elektrycznie regulowane i podgrzewane lusterka;
• ABS, 2 poduszki . . .
Samochód w pełni sprawny, serwisowany w porządnym warsztacie, specjalizującym się w autach Skody. 
Pełna książka serwisowa.
Rozrząd wymieniony przy 202.000. Silnik znany z trwałości i dobrej pracy z LPG.
A że samochód ma swoje lata, to:
- pojawia się rdza, zderzak przedni pęknięty, maska lekko wgnieciona,
rysy parkingowe na drzwiach . . . co widać na zdjęciach.
Oleju praktycznie nie bierze, za to co pewien czas trzeba dolać płynu chłodzącego.
Proszę o kontakt po godz. 18-ej.

Sam sprowadziłem z Niemiec w listopadzie 2019, przebieg oryginalny, mam papiery, książkę serwisową. Od razu wymieniłem cały układ wydechowy, świece, filtry, płyny, opony (całoroczne Nokian). Jestem jedynym użytkownikiem, przejechałem 35000 km. Regularne serwisowanie w Q-Service przy Jugosłowiańskiej zgodnie z kartą technologiczną Toyoty (filtry i olej tylko japońskie). Przegląd i OC do 04.11.2025. 

Pozytyw: 

1. silnik, zawieszenie, cała mechanika w stanie idealnym;

2. elektryczne szyby i lusterka; 

3. tapicerka i obicia w stanie bardzo dobrym;

4. pełnowartościowe koło zapasowe;

5. od 11.2024 nowe chłodnica i akumulator. 

Negatyw: 

1. brak klimatyzacji;

2. wymaga prac blacharskich próg (prawy tył), zderzak lewy przód;

3. prawy bok jak i dach przy szybie czołowej były już przy kupnie takie jak na foto (mnie to nie przeszkadza, na jazdę nie wpływa);

4. od początku nie działa centralny zamek.
